import React, { Component } from 'react'
import axios from "axios"
import { API_URL } from "./constants/index.js"


import GCInput from "./GCInput"
import { render } from '@testing-library/react'
import { Row, Container } from 'react-bootstrap'
import { Col } from 'react-bootstrap'

class GCOutput extends React.Component {
    state = {
        sequences: []
    };

    componentDidMount() {
        this.resetState();
      }

    getSequences = () => {
        axios.get(API_URL)
            .then(res => this.setState({ sequences: res.data[res.length-1]}))
            .catch(console.log)
    }

    resetState = () => {
        this.getSequences();
    }
    render() {
        return (
            <Row>  
                <Col><p>A: <textarea type="text"/></p></Col> 
                <Col><p>C: <textarea type="text"/></p></Col>
                <Col><p>G: <textarea type="text"/></p></Col>
                <Col><p>T: <textarea type="text"/></p></Col>
                <Col><p>GC: <textarea type="text"/></p></Col>
            </Row>
        )

    }
}



export default GCOutput;
